import React from 'react';

function Tile(props) {

  function poner_foto(symbol){
    const url = ""
    if (symbol === "cacao seco"){
      url = "../imgs/cacao.png"
      return url;
    }
    if (symbol === "cacao"){
      url = "../imgs/cacao.png"
      return url;
    }

    if (symbol === "chocolate"){
      url = "../imgs/cacao.png"
      return url;
    }

  }
    return (
      <section className="Tile">
        <p id="p_tile">{props.symbol}</p>
        <img src={poner_foto(props.symbol)} alt="img" className='img_tile'></img>

      </section>
    );
  }

  export default Tile;
